import {Bar} from 'react-chartjs-2';
import dados from '../src/dados/dadosUsina.json';
console.log(dados)

function App() {
  return (
    <div className="App">
      <header className="appBar">
        <ul>
          <li><a href="#">a</a></li>
          <li><a href="#">a</a></li>
          <li><a href="#">a</a></li>
        </ul>
      </header>
      <main className="main">

          <div className="grafico">
          <Bar
         { ...dados.forEach(element => {
            console.log(element.tensao_V)
          })}
              data={{

                labels:dados.map((elem) => ([elem.temperatura_C])),
                datasets: [
                  {
                    label: 'tensao por hora ',
                    data: dados.map((elem) => ([elem.tempo_h])),
                    backgroundColor:'blue',
                  },
                  {
                    label: 'tensao',
                    data:dados.map((elem) => ([elem.tensao_V])),
                    backgroundColor: 'red',
                  }
                ]
              }}
              height={400}
              width={600}
              options={{
                maintainAspectRatio:false,
                scales: {
                  yAxes
                }
              }}
           />
          </div>

      </main>
    </div>
  );
}

export default App;
